import React from "react";


function TableBody(props) {
return (
  <div>
    {props.results.map((result) => (
    <table className="table table-dark">
      <tbody>
        <tr>
          <td className="text-center" scope="col">Photo</td>
          <td className="text-center" scope="col">Name</td>
          <td className="text-center" scope="col">Email: {result.email}</td>
          <td className="text-center" scope="col">Phone Number</td>
          <td className="text-center" scope="col">Date of Birth</td>
        </tr>
      </tbody>
    </table>
    ))}
  </div>
  )
}

export default TableBody;
